import { history } from "../../App";
import QuanLyNguoiDungServ from "../../services/QuanLyNguoiDungservice";
import { Button, Result } from "antd";

export const dangKyAction = (data) => {
  return (dispatch) => {
    QuanLyNguoiDungServ.dangKy(data)
      .then((res) => {
        // console.log("res", res);
        setTimeout(() => {
          history.push("/login");
          <Result status="success" title="Đăng ký thành công!" />;
        }, 3000);
      })
      .catch((err) => {
        console.log("err", err);
      });
  };
};
